const Reducer = (state, action) => {
  switch(action.type) {
    case "SET_USER":
        state = {
          ...state,
          user: action.user
        }
      break;

    case "CLEAR":

      break;

    default: 
      return state;
  }

  return state;
}

export default Reducer;
